import React from "react";


const FriendRequest = () => {

    return (
        <div className="center">
            <div className="row container">
                <p className="col s12">Danijel Venus</p>
                <a className="col s4" class="waves-effect  waves-light teal btn">Dodaj</a>
                <a className="col s4" class="waves-effect waves-light red btn">Odbi</a>
            </div>
        </div>
    );

};

export default FriendRequest;
